import { getProdattributeCheckLISTAPI } from '@/api/productApi.js';
export default {
  name: "",
  data: function data() {
    return {
      checkList: [],
      shoptypeform: [],
      params: {
        province: [],
        checked: {}
      }
    };
  },
  components: {},
  methods: {
    // 获取分类数据
    getattributelist: function getattributelist() {
      var _this = this;

      console.log('属性组');
      getProdattributeCheckLISTAPI().then(function (res) {
        var data = res.data.data; // for(let i=0;i<data.length;i++){
        //     data[i].ischeck=false
        // }

        _this.shoptypeform = data;
      }).catch(function (err) {
        _this.tableLoading = false;
      });
    },
    savestopattribute: function savestopattribute() {
      var savecheckdata = this.checkList;
      var saveattrdata = this.shoptypeform;
      var addname = '';
      console.log(savecheckdata);

      for (var i = 0; i < savecheckdata.length; i++) {
        for (var j = 0; j < saveattrdata.length; j++) {
          if (savecheckdata[i] == saveattrdata[j].title) {
            if (i == 0) {
              addname += saveattrdata[j].names;
            } else {
              addname += ',' + saveattrdata[j].names;
            }
          }
        }
      }

      this.$emit('changeattrlist', addname);
      this.$emit('close-form');
    }
  },
  mounted: function mounted() {
    this.getattributelist();
  }
};
